contracts/KursBilgileri.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;

import "./BaseContract.sol";
import "./EgitimBilgileri.sol";

contract KursBilgileri is BaseContract{
  uint public id;

    struct KursBilgi {
         uint id;
         address kursAdres;
         uint basTarih;
         uint bitTarih;
         uint8 sure;
         string egitimAdi;
        }
        mapping(address=>mapping(uint=>KursBilgi)) public kursBilgiListesi;



        event KursEklendiLog(address _kursAdres,uint _basTarih, uint _bitTarih,uint8  _sure);
        event KursGuncellendiLog(address _kursAdres,uint _basTarih, uint _bitTarih,uint8  _sure);

         function ekleKursBilgi(address _kisiAddress, KursBilgi memory _kursBilgi)  public sadeceKurs{
             require(kisiler[_kisiAddress].durum,"Kisi mevcut degil");
             uint yeniId=id++;
             kursBilgiListesi[_kisiAddress][yeniId].kursAdres=_kursBilgi.kursAdres;
             kursBilgiListesi[_kisiAddress][yeniId].basTarih=_kursBilgi.basTarih;
             kursBilgiListesi[_kisiAddress][yeniId].bitTarih=_kursBilgi.bitTarih;
             kursBilgiListesi[_kisiAddress][yeniId].sure=_kursBilgi.sure;
             kursBilgiListesi[_kisiAddress][yeniId].egitimAdi=_kursBilgi.egitimAdi;
            
           
            emit KursEklendiLog(_kursBilgi.kursAdres, _kursBilgi.basTarih, _kursBilgi.bitTarih, _kursBilgi.sure);
        }
          function guncelleKursBilgi(address _kisiAddress, KursBilgi memory _kursBilgi)  public sadeceKurs returns(uint){
                require(kisiler[_kisiAddress].durum,"Kisi mevcut degil");
                
             kursBilgiListesi[_kisiAddress][_kursBilgi.id].kursAdres=_kursBilgi.kursAdres;
             kursBilgiListesi[_kisiAddress][_kursBilgi.id].basTarih=_kursBilgi.basTarih;
             kursBilgiListesi[_kisiAddress][_kursBilgi.id].bitTarih=_kursBilgi.bitTarih;
             kursBilgiListesi[_kisiAddress][_kursBilgi.id].sure=_kursBilgi.sure;
             kursBilgiListesi[_kisiAddress][_kursBilgi.id].egitimAdi=_kursBilgi.egitimAdi;
              
              emit KursGuncellendiLog(_kursBilgi.kursAdres, _kursBilgi.basTarih, _kursBilgi.bitTarih, _kursBilgi.sure);
                return    _kursBilgi.id;

        }



}

contracts/EgitimBilgileri.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;
//pragma experimental ABIEncoderV2;
import "./BaseContract.sol";
contract EgitimBilgileri is BaseContract{
  uint public id;


    struct EgitimBilgi {
          uint id;
         EgitimDurumu egitimDurumu;
         uint basTarih;
         uint bitTarih;
         uint8 diplomaNotu;
         bytes32 diplomaBelge;
         bytes32 transcriptBelge;
         address universite;
         uint16 fakulte;
         uint16 bolum;
         OgretimTipi ogretimTipi;
         uint32 ogretimDili;
         //uint8 ulke;
         //uint32 sehir;
        }
       
         enum EgitimDurumu { 
             Lisans, 
             OnLisans, 
             YuksekLisans,
             Doktora }

         enum OgretimTipi { 
             OrgunOgretim, 
             AcikOgretim, 
             IkinciOgretim,
             UzaktanOgretim }

               mapping(address=>mapping(uint=>EgitimBilgi)) public egitimBilgileri;
      
      
        event EgitimBilgiEklendiLog(uint id,address _universite,uint basTarih, uint bitTarih);
          event EgitimBilgiGuncellendiLog(uint id,address _universite,uint basTarih, uint bitTarih);

         function ekleEgitimBilgi(address _kisiAddress, EgitimBilgi memory _egitimBilgi)  public sadeceUniversite{
             require(kisiler[_kisiAddress].durum,"Student not exists");
             uint yeniId=id++;
             egitimBilgileri[_kisiAddress][yeniId].egitimDurumu=_egitimBilgi.egitimDurumu;
             egitimBilgileri[_kisiAddress][yeniId].basTarih=_egitimBilgi.basTarih;
             egitimBilgileri[_kisiAddress][yeniId].bitTarih=_egitimBilgi.bitTarih;
             egitimBilgileri[_kisiAddress][yeniId].diplomaNotu=_egitimBilgi.diplomaNotu;
             egitimBilgileri[_kisiAddress][yeniId].diplomaBelge=_egitimBilgi.diplomaBelge;
             egitimBilgileri[_kisiAddress][yeniId].transcriptBelge=_egitimBilgi.transcriptBelge;
             egitimBilgileri[_kisiAddress][yeniId].universite=_egitimBilgi.universite;
             egitimBilgileri[_kisiAddress][yeniId].fakulte=_egitimBilgi.fakulte;
             egitimBilgileri[_kisiAddress][yeniId].bolum=_egitimBilgi.bolum;
             egitimBilgileri[_kisiAddress][yeniId].ogretimTipi=_egitimBilgi.ogretimTipi;
             egitimBilgileri[_kisiAddress][yeniId].ogretimDili=_egitimBilgi.ogretimDili;
           //  egitimBilgileri[_personAddress][yeniId].ulke=_egitimBilgi.ulke;
            // egitimBilgileri[_personAddress][yeniId].sehir=_egitimBilgi.sehir;
           
             emit EgitimBilgiEklendiLog( yeniId, _egitimBilgi.universite,_egitimBilgi.basTarih, _egitimBilgi.bitTarih);
    }
       function guncelleEgitimBilgi(address _kisiAddress, EgitimBilgi memory _egitimBilgi)  public sadeceUniversite returns(uint){
             require(kisiler[_kisiAddress].durum,"Student not exists");
             
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].egitimDurumu=_egitimBilgi.egitimDurumu;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].basTarih=_egitimBilgi.basTarih;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].bitTarih=_egitimBilgi.bitTarih;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].diplomaNotu=_egitimBilgi.diplomaNotu;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].diplomaBelge=_egitimBilgi.diplomaBelge;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].transcriptBelge=_egitimBilgi.transcriptBelge;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].universite=_egitimBilgi.universite;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].fakulte=_egitimBilgi.fakulte;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].bolum=_egitimBilgi.bolum;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].ogretimTipi=_egitimBilgi.ogretimTipi;
             egitimBilgileri[_kisiAddress][_egitimBilgi.id].ogretimDili=_egitimBilgi.ogretimDili;
           //  egitimBilgileri[_personAddress][_egitimBilgi.id].ulke=_egitimBilgi.ulke;
           //  egitimBilgileri[_personAddress][_egitimBilgi.id].sehir=_egitimBilgi.sehir;
           
             emit EgitimBilgiGuncellendiLog( _egitimBilgi.id, _egitimBilgi.universite,_egitimBilgi.basTarih, _egitimBilgi.bitTarih);
             return    _egitimBilgi.id;

    }
     
}

contracts/BaseContract.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;
contract BaseContract{
     address YOK;
  address TOBB;
  address CB;
  struct  Kisi
    {
      bool durum;
    
    }
   struct Universite
        {
        bool durum;
        string isim;
        uint8 ulke;
        }

        struct Akademisyen
        {
        bool durum;
        address universite;
        uint16 bolum;
        Unvan unvan; 
        string ad;
        string soyad;
        }

        enum Unvan { DR, AS_PROF, PROF,MD }    
  enum OnaylayanKurum { 
             Universite, 
             Firma, 
             Kamu,
             STK,
             SertifikaMerkezi }
     struct Firma
    {
      bool durum;
      uint8 ulke;
      uint vergiNo;
      string isim;
    }
     struct KamuKurumu
    {
      bool durum;
      string isim;
      uint8 ulke;
    }
      struct STK
    {
      bool durum;
      string isim;
      uint8 ulke;
    }
      struct SertifikaMerkezi
    {
      bool durum;
      string isim;
      uint8 ulke;
    }
    struct Kurs
    {
      bool durum;
      string isim;
      uint8 ulke;
    }

     struct YabanciDil
    {
      uint32 id;
      string isim;
    }
      modifier sadeceYOK{
      require(msg.sender == YOK,
      "Sadece YOK bu islemi yapabilir."
      );
      _;
     }    
    
      modifier sadeceTOBB{
      require(msg.sender == TOBB,
      "Sadece TOBB bu islemi yapabilir."
      );
      _;
     }

      modifier sadeceCB{
      require(msg.sender == CB,
      "Sadece CB bu islemi yapabilir."
      );
      _;
    }    

      modifier sadeceUniversite{
      require(universiteler[msg.sender].durum,
      "Sadece Universite bu islemi yapabilir."
      );
      _;
    } 

      modifier sadeceKurs{
      require(kurslar[msg.sender].durum,
      "Bu islemi sadece Kurs yapabilir."
      );
      _;
    } 
        modifier onlyCourse{
      require(sertifikaMerkezleri[msg.sender].durum,
      "Bu islemi sadece Sertifika Merkezleri yapabilir."
      );
      _;
    } 

      modifier sadece_Uni_Firma_Kamu{
      require(universiteler[msg.sender].durum||firmalar[msg.sender].durum||kamuKurumlari[msg.sender].durum,
      "Bu islemi sadece Kurs yapabilir."
      );
      _;
    } 
      modifier onlyKontratSahibi {
      require(msg.sender == address(this),
      "Bu islemi sadece kontrat sahibi yapabilir"
      );
      _;
    }

    mapping(address=>Kisi) public kisiler;
    mapping(address=>Universite) public universiteler;
    mapping(address=>Akademisyen) public akademisyenler;
    mapping(address=>Firma) public  firmalar;
    mapping(address=>Kurs) public  kurslar;
    mapping(address=>KamuKurumu) public kamuKurumlari;
    mapping(address=>STK) public stklar;
    mapping(address=>SertifikaMerkezi) public sertifikaMerkezleri;

     mapping(uint32=>YabanciDil) public diller;
}

